import React from 'react';
import { NavLink } from 'react-router-dom';
import { getToken } from '../utils/Commons';

class LinkMenu extends React.Component{
    render () {
        return (
              getToken()  ?  <NavLink exact activeClassName="active" to={this.props.urlto}>{this.props.texttourl}</NavLink>  :  <NavLink exact activeClassName="active" to={this.props.urlto}>{this.props.texttourl}</NavLink>
        );
    }
}

export default LinkMenu;
